import React, { Component } from 'react';
import styles from "./Card.module.css"

class Card extends Component {
    render() {
        const{image,name,place}=this.props;
        return (
            <div className={styles.container}>
                <img src={image} alt="beautiful-place"></img> 
                <h3>{name}</h3>               
                <p>{place}</p>
            </div>
        );
    }
}

export default Card;
